import React, { Component } from "react";
import Weather from "./weather.js";
import { Link } from "react-router-dom";
class Mainpage extends Component {
  render() {
    return (
      <div>
        <Router>
          <div>
            <nav>
              <Link to="./weather.js">Weather</Link>
            </nav>
          </div>
        </Router>
      </div>
    );
  }
}
export default Mainpage;
